import "./App.css";
import Customer from "./components/Customer";

const customer = {
  id: 1,
  image: "https://placeimg.com/64/64/any",
  name: "박엘리나",
  birthday: "920604",
  gender: "여자",
  job: "취준생",
};

function App() {
  return (
    <Customer
      id={customer.id}
      image={customer.image}
      name={customer.name}
      birthday={customer.birthday}
      gender={customer.gender}
      job={customer.job}
    />
  );
}

export default App;
